    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    outlines Refuge accomplishments from February through April of 1942. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments and wildfires. Resource management
    is outlined; topics include grazing. The public relations section of the report
    describes recreational uses and Refuge visitors.",nt"license_title": "License
